 bg_overlay=\"rgba(22, 20, 16, 0.18)\" hover=\"glow\"]\n\n[text_box width=\"36\" position_x=\"90\"]\n\n<h3>Small Title</h3>\n<p class=\"lead\">You can place a text box wherever you want on a Banner</p>\n[button text=\"Click me!\"]\n\n\n[/text_box]\n\n[/ux_banner]\n\n[/col]\n[col span=\"6\" span__sm=\"12\" align=\"center\"]\n\n<h2>Banner Focus Point<b></b></h2>\n<p class=\"lead\">Set a focus point on the banner and the image will adjust to mobile a tablet screens. Perfect for resposnive Websites.</p>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"9127\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n[title style=\"center\" text=\"Banner Hover effects\"]\n\n[row]\n\n[col span=\"4\"]\n\n[ux_banner height=\"200px\" bg=\"4059\" bg_size=\"medium\" bg_overlay=\"rgba(22, 20, 16, 0.18)\" hover=\"glow\"]\n\n[text_box width=\"36\"]\n\n<h3>Glow</h3>\n\n[/text_box]\n\n[/ux_banner]\n\n[/col]\n[col span=\"4\"]\n\n[ux_banner height=\"200px\" bg=\"4059\" bg_size=\"medium\" bg_overlay=\"rgba(22, 20, 16, 0.18)\" hover=\"zoom\"]\n\n[text_box width=\"36\"]\n\n<h3>Zoom</h3>\n\n[/text_box]\n\n[/ux_banner]\n\n[/col]\n[col span=\"4\"]\n\n[ux_banner height=\"200px\" bg=\"4059\" bg_size=\"medium\" bg_overlay=\"rgba(22, 20, 16, 0.18)\" hover=\"zoom-fade\"]\n\n[text_box width=\"36\"]\n\n<h3>Zoom Fade</h3>\n\n[/text_box]\n\n[/ux_banner]\n\n[/col]\n[col span=\"4\"]\n\n[ux_banner height=\"200px\" bg=\"4059\" bg_size=\"medium\" bg_overlay=\"rgba(22, 20, 16, 0.18)\" hover=\"blur\"]\n\n[text_box width=\"36\"]\n\n<h3>Blur</h3>\n\n[/text_box]\n\n[/ux_banner]\n\n[/col]\n[col span=\"4\"]\n\n[ux_banner height=\"200px\" bg=\"4059\" bg_size=\"medium\" bg_overlay=\"rgba(22, 20, 16, 0.18)\" hover=\"fade-in\"]\n\n[text_box width=\"36\"]\n\n<h3>Fade In</h3>\n\n[/text_box]\n\n[/ux_banner]\n\n[/col]\n[col span=\"4\"]\n\n[ux_banner height=\"200px\" bg=\"4059\" bg_size=\"medium\" bg_overlay=\"rgba(22, 20, 16, 0.18)\" hover=\"fade-out\"]\n\n[text_box width=\"36\"]\n\n<h3>Fade Out</h3>\n\n[/text_box]\