INSERT INTO `wp_posts` VALUES (553,1,'2020-05-21 11:52:56','2020-05-21 14:52:56','<!-- wp:html -->\n[ux_banner height=\"100%\" bg=\"399\" bg_overlay=\"rgba(0, 0, 0, 0.27)\" bg_overlay__sm=\"rgba(0,0,0,.5)\" bg_pos=\"92% 0%\" parallax=\"4\"]\n\n[text_box width=\"51\" width__sm=\"90\" scale__sm=\"131\" animate=\"fadeInUp\" parallax=\"-3\" position_x=\"50\" position_x__sm=\"50\" position_y=\"20\" position_y__sm=\"90\" text_depth=\"1\"]\n\n<p><script src=\"https://kit.fontawesome.com/c89968659d.js\" crossorigin=\"anonymous\"></script></p>\n<h4 class=\"uppercase\"><span style=\"color: #f5f5f5;\">proteja-se e ajude</span></h4>\n<h4 class=\"uppercase\"><span style=\"color: #f5f5f5;\">quem mais precisa.</span></h4>\n<p></p>\n<p class=\"lead\"><span style=\"color: #f5f5f5;\">Para cada compra com caixa com 50 unidades, cinco mscaras sero doadas a asilos.</span></p>\n[button text=\"Entrar na Loja\" size=\"large\" link=\"/loja\"]\n\n\n[/text_box]\n\n[/ux_banner]\n[title style=\"center\" text=\"Instituies beneficiadas\"]\n\n[row v_align=\"middle\"]\n\n[col span=\"4\" span__sm=\"12\" align=\"center\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\" divider=\"0\" align=\"center\"]\n\n[logo img=\"414\" title=\"Assistncia Social Dom Jos Gaspar Ikoi-no-Sono\" hover=\"color\" height=\"130px\" link=\"/ajude-ikoi-no-sono/\" target=\"_blank\"]\n\n<p>As vendas realizadas neste site sero revertidas em doao de 10% do valor em mscaras para a Instituio Assistncia Social Dom Jos Gaspar (Ikoi-no-sono)</p>\n[button text=\"Saiba mais...\" letter_case=\"lowercase\" link=\"/ajude-ikoi-no-sono/\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\" align=\"center\"]\n\n\n[/col]\n\n[/row]\n[gap]\n\n[gap]\n\n[section label=\"Media Right\" bg_color=\"rgb(207, 207, 207)\" bg_overlay=\"rgba(255, 255, 255, 0.85)\" padding=\"60px\" border=\"0px 0px 0 0px\" border_color=\"rgb(255, 255, 255)\"]\n\n[row style=\"large\" h_align=\"center\"]\n\n[col span=\"6\" span__sm=\"12\" align=\"left\"]\n\n[accordion]\n\n[accordion-item title=\"O que posso fazer para me proteger e evitar transmitir para outras pessoas?\"]\n\n<p>A maioria das pessoas infectadas experimenta uma doena leve e se recupera, mas pode ser mais grave para outras pessoas. Mantenha-se informado sobre os ltimos desenvolvimentos a respeito do COVID-19 e faa o seguinte para cuidar da sua sade e proteger a dos outros:</p>\n<ul>\n<li>Lave as mos com gua e sabo ou higienizador  base de lcool para matar vrus que podem estar nas suas mos.</li>\n<li>Mantenha pelo menos 1 metro de distncia entre voc e qualquer pessoa que esteja tossindo ou espirrando. Quando algum tosse ou espirra, pulveriza pequenas gotas lquidas do nariz ou da boca, que podem conter vrus. Se voc estiver muito prximo, poder inspirar as gotculas  inclusive do vrus da COVID-19 se a pessoa que tossir tiver a doena.</li>\n<li>Evite tocar nos olhos, nariz e boca. As mos tocam muitas superfcies e podem ser infectadas por vrus. Uma vez contaminadas, as mos podem transferir o vrus para os olhos, nariz ou boca. A partir da, o vrus pode entrar no corpo da pessoa e deix-la doente.</li>\n<li>Certifique-se de que voc e as pessoas ao seu redor seguem uma boa higiene respiratria. Isso significa cobrir a boca e o nariz com a parte interna do cotovelo ou leno quando tossir ou espirrar (em seguida, descarte o leno usado imediatamente). Gotculas espalham vrus. Ao seguir uma boa higiene respiratria, voc protege as pessoas ao seu redor contra vrus responsveis por resfriado, gripe e COVID-19.</li>\n<li>Fique em casa se no se sentir bem. Se voc tiver febre, tosse e dificuldade em respirar, procure atendimento mdico. Siga as instrues da sua autoridade sanitria nacional ou local, porque elas sempre tero as informaes mais atualizadas sobre a situao em sua rea.</li>\n<li>Pessoas doentes devem adiar ou evitar viajar para as reas afetadas por coronavrus. reas afetadas so pases, reas, provncias ou cidades onde h transmisso contnua  no reas com apenas casos importados.</li>\n<li>Os viajantes que retornam das reas afetadas devem monitorar seus sintomas por 14 dias e seguir os protocolos nacionais dos pases receptores; e se ocorrerem sintomas, devem entrar em contato com um mdico e informar sobre o histrico de viagem e os sintomas.</li>\n</ul>\n<p><a href=\"https://sbpt.org.br/portal/covid-19-oms/\" target=\"_blank\" rel=\"noopener noreferrer\">fonte: https://sbpt.org.br/portal/covid-19-oms/</a></p>\n\n[/accordion-item]\n[accordion-item title=\"Qual  a orientao da OPAS e da OMS no que diz respeito ao uso de mscaras?\"]\n\n<p>A OPAS e a OMS recomendam que as mscaras cirrgicas sejam usadas por:</p>\n<ul>\n<li>pessoas com sintomas respiratrios, como tosse ou dificuldade de respirar, inclusive ao procurar atendimento mdico</li>\n<li>profissionais de sade e pessoas que prestam atendimento a indivduos com sintomas respiratrios</li>\n<li>profissionais de sade, ao entrar em uma sala com pacientes ou tratar um indivduo com sintomas respiratrios</li>\n</ul>\n<p>O uso de mscaras no  necessrio para pessoas que no apresentem sintomas respiratrios. No entanto, mscaras podem ser usadas em alguns pases de acordo com os hbitos culturais locais.</p>\n<p>As pessoas que usarem mscaras devem seguir as boas prticas de uso, remoo e descarte, assim como higienizar adequadamente as mos antes e aps a remoo. Devem tambm lembrar que o uso de mscaras deve ser sempre combinado com as outras medidas de proteo (veja a pergunta O que posso fazer para me proteger e evitar transmitir para outras pessoas?).</p>\n<p>Como colocar, usar, tirar e descartar uma mscara:</p>\n<p>1. Lembre-se de que uma mscara deve ser usada apenas por profissionais de sade, cuidadores e indivduos com sintomas respiratrios, como febre e tosse.<br />2. Antes de tocar na mscara, limpe as mos com um higienizador  base de lcool ou gua e sabo<br />3. Pegue a mscara e verifique se est rasgada ou com buracos.<br />4. Oriente qual lado  o lado superior (onde est a tira de metal).<br />5. Assegure-se que o lado correto da mscara est voltado para fora (o lado colorido).<br />6. Coloque a mscara no seu rosto. Aperte a tira de metal ou a borda rgida da mscara para que ela se adapte ao formato do seu nariz.<br />7. Puxe a parte inferior da mscara para que ela cubra sua boca e seu queixo.<br />8. Aps o uso, retire a mscara; remova as presilhas elsticas por trs das orelhas, mantendo a mscara afastada do rosto e das roupas, para evitar tocar nas superfcies potencialmente contaminadas da mscara.<br />9. Descarte a mscara em uma lixeira fechada imediatamente aps o uso.<br />10. Higienize as mos depois de tocar ou descartar a mscara  use um higienizador de mos  base de lcool ou, se estiverem visivelmente sujas, lave as mos com gua e sabo.</p>\n<p><a href=\"https://sbpt.org.br/portal/covid-19-oms/\" target=\"_blank\" rel=\"noopener noreferrer\">fonte: https://sbpt.org.br/portal/covid-19-oms/</a></p>\n\n[/accordion-item]\n\n[/accordion]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[scroll_to title=\"Fale Conosco\" link=\"#FaleConosco\" bullet=\"false\"]\n\n<h3>FALE CONOSCO</h3>\n<p>Entre em contato com nossa equipe: </p>\n[contact-form-7 id=\"22\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n\n<!-- /wp:html -->','Agency','','inherit','closed','closed','','74-revision-v1','','','2020-05-21 11:52:56','2020-05-21 14:52:56','',74,'https://www.masklife.com.br/2020/05/21/74-revision-v1/',0,'revision','',0);
