INSERT INTO `wp_wc_admin_notes` VALUES (16,'wc-admin-store-notice-giving-feedback-2','info','en_US','Give feedback','Now that youve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.','info','{}','unactioned','woocommerce-admin','2020-07-10 20:37:02',NULL,0,'plain','',0);
INSERT INTO `wp_wc_admin_notes` VALUES (2,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','info','{}','unactioned','woocommerce-admin','2019-10-31 20:36:30',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (3,'wc-admin-historical-data','update','en_US','WooCommerce Admin: dados histricos de anlise','Para visualizar seus dados histricos de anlise, voc deve processar seus pedidos e clientes existentes.','info','{}','actioned','woocommerce-admin','2019-11-01 00:21:07',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (4,'wc-admin-mobile-app','info','en_US','Instale o aplicativo Woo','Instale o aplicativo do WooCommerce para gerenciar pedidos, receber notificaes de vendas e visualizar as principais mtricas - onde quer que voc esteja.','phone','{}','unactioned','woocommerce-admin','2019-11-11 03:57:51',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (14,'wc-admin-coupon-page-moved','update','en_US','Coupon management has moved!','Coupons can now be managed from Marketing &gt; Coupons. Click the button below to remove the legacy WooCommerce &gt; Coupons menu item.','info','{}','unactioned','woocommerce-admin','2020-07-10 13:29:33',NULL,0,'plain','',0);
INSERT INTO `wp_wc_admin_notes` VALUES (6,'wc-admin-facebook-extension','info','en_US','Venda no Facebook','Grow your business by targeting the right people and driving sales with Facebook. You can install this free extension now.','thumbs-up','{}','actioned','woocommerce-admin','2020-04-29 19:04:49',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (15,'wc-admin-marketing-intro','info','en_US','Connect with your audience','Grow your customer base and increase your sales with marketing tools built for WooCommerce.','info','{}','unactioned','woocommerce-admin','2020-07-10 20:37:02',NULL,0,'plain','',0);
INSERT INTO `wp_wc_admin_notes` VALUES (8,'wc-update-db-reminder','update','en_US','Atualizao do banco de dados WooCommerce concluda','A atualizao do WooCommerce est concluda. Obrigado por atualizar para a ltima verso!','info','{}','actioned','woocommerce-core','2020-04-30 22:32:32',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (13,'wc-admin-new-sales-record','info','en_US','Novo recorde de vendas!','Woohoo, May 6th was your record day for sales! Net Sales was R$954,77 beating the previous record of R$954,77 set on May 6th.','trophy','{\"old_record_date\":\"2020-05-06\",\"old_record_amt\":954.76999999999998181010596454143524169921875,\"new_record_date\":\"2020-05-06\",\"new_record_amt\":954.7700000000000954969436861574649810791015625}','unactioned','woocommerce-admin','2020-05-07 20:43:57',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (10,'wc-admin-onboarding-email-marketing','info','en_US','Tips, product updates, and inspiration','We\'re here for you  get tips, product updates, and inspiration straight to your mailbox.','mail','{}','unactioned','woocommerce-admin','2020-05-02 21:11:41',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (12,'wc-admin-usage-tracking-opt-in','info','en_US','Help WooCommerce improve with usage tracking','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"https://www.masklife.com.br/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.','info','{}','unactioned','woocommerce-admin','2020-05-07 14:42:53',NULL,0,'',NULL,0);
INSERT INTO `wp_wc_admin_notes` VALUES (17,'wc-admin-learn-more-about-product-settings','info','en_US','Learn more about Product Settings','In this video you\'ll find information about configuring product settings, such as how they are displayed, editing inventory options and so on.','info','{}','unactioned','woocommerce-admin','2020-07-10 20:37:02',NULL,0,'plain','',0);
